import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  PieChart, Pie, Cell, 
  LineChart, Line,
  ComposedChart,
  ScatterChart, Scatter,
  ResponsiveContainer,
  ReferenceLine,
  RadarChart, Radar, PolarGrid, PolarAngleAxis, PolarRadiusAxis
} from 'recharts';
import { 
  Camera, 
  TrendingUp, 
  BarChart2, 
  Layers, 
  PieChart as PieChartIcon 
} from 'lucide-react';
import './App.css';

function ExploratoryDataAnalysisPage() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dataOverview, setDataOverview] = useState(null);

  // Advanced visualization data
  const targetDistributionData = [
    { name: 'Approved', value: 3750, color: '#4CAF50', icon: <Camera size={24} /> },
    { name: 'Rejected', value: 1250, color: '#F44336', icon: <TrendingUp size={24} /> }
  ];

  const featureCorrelationData = [
    { feature: 'Age', correlation: 0.35 },
    { feature: 'Income', correlation: 0.62 },
    { feature: 'Experience', correlation: 0.45 },
    { feature: 'Credit Score', correlation: 0.55 }
  ];

  const detailedFeatureData = [
    { 
      feature: 'Age', 
      min: 25, 
      max: 60, 
      average: 40, 
      distribution: [
        { range: '20-30', count: 500 },
        { range: '31-40', count: 1500 },
        { range: '41-50', count: 2000 },
        { range: '51-60', count: 1000 }
      ]
    },
    { 
      feature: 'Income', 
      min: 30000, 
      max: 150000, 
      average: 75000,
      distribution: [
        { range: '30k-50k', count: 800 },
        { range: '50k-75k', count: 1500 },
        { range: '75k-100k', count: 1700 },
        { range: '100k+', count: 1000 }
      ]
    }
  ];

  const riskProfileData = [
    { feature: 'Credit Risk', A: 80, B: 60, C: 40, fullMark: 100 },
    { feature: 'Loan Eligibility', A: 70, B: 85, C: 65, fullMark: 100 },
    { feature: 'Default Probability', A: 50, B: 45, C: 75, fullMark: 100 },
    { feature: 'Payment History', A: 90, B: 75, C: 55, fullMark: 100 }
  ];

  useEffect(() => {
    const timer = setTimeout(() => {
      setDataOverview({
        total_records: 5000,
        features: 12,
        target_distribution: {
          approved: 3750,
          rejected: 1250
        },
        missing_values: "None",
        data_types: {
          numerical: ["Age", "Experience", "Income", "ZIP Code", "Family", "CCAvg", "Mortgage"],
          categorical: ["Education", "Securities Account", "CD Account", "Online", "CreditCard"]
        }
      });
      setLoading(false);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  if (loading) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="loading-indicator">
          <Layers size={48} className="animate-spin" />
          Loading data analysis...
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="error-message">Error loading data: {error}</div>
      </div>
    );
  }

  return (
    <div className="page-container">
      <h1 className="text-2xl font-bold mb-6 flex items-center">
        <BarChart2 size={32} className="mr-3" /> 
        Exploratory Data Analysis
      </h1>
      
      <div className="eda-container grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Target Distribution Pie Chart */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4 flex items-center">
            <PieChartIcon size={24} className="mr-2" />
            Loan Approval Distribution
          </h2>
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie
                data={targetDistributionData}
                cx="50%"
                cy="50%"
                labelLine={false}
                outerRadius={80}
                dataKey="value"
                label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
              >
                {targetDistributionData.map((entry) => (
                  <Cell key={entry.name} fill={entry.color} />
                ))}
              </Pie>
              <Tooltip 
                formatter={(value, name) => [
                  `${value} loans (${((value / dataOverview.total_records) * 100).toFixed(2)}%)`, 
                  name
                ]}
              />
              <Legend 
                iconType="circle"
                formatter={(value, entry) => (
                  <span className="flex items-center">
                    {entry.payload.icon}
                    <span className="ml-2">{value}</span>
                  </span>
                )}
              />
            </PieChart>
          </ResponsiveContainer>
        </div>

        {/* Feature Correlation Line Chart */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Feature Correlation Strengths</h2>
          <ResponsiveContainer width="100%" height={300}>
            <ComposedChart data={featureCorrelationData}>
              <XAxis dataKey="feature" />
              <YAxis domain={[-1, 1]} />
              <CartesianGrid strokeDasharray="3 3" />
              <Tooltip />
              <ReferenceLine y={0} stroke="#000" />
              <Bar dataKey="correlation" barSize={20} fill="#8884d8" />
              <Line type="monotone" dataKey="correlation" stroke="#FF7300" />
            </ComposedChart>
          </ResponsiveContainer>
        </div>

        {/* Detailed Feature Distribution */}
        <div className="bg-white shadow-lg rounded-lg p-6 col-span-full">
          <h2 className="text-xl font-semibold mb-4">Detailed Feature Distribution</h2>
          <div className="grid grid-cols-2 gap-4">
            {detailedFeatureData.map((feature) => (
              <div key={feature.feature}>
                <h3 className="font-medium mb-2">{feature.feature} Distribution</h3>
                <ResponsiveContainer width="100%" height={200}>
                  <BarChart data={feature.distribution}>
                    <XAxis dataKey="range" />
                    <YAxis />
                    <Tooltip />
                    <Bar dataKey="count" fill="#82ca9d" />
                  </BarChart>
                </ResponsiveContainer>
              </div>
            ))}
          </div>
        </div>

        {/* Risk Profile Radar Chart */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Risk Profile Analysis</h2>
          <ResponsiveContainer width="100%" height={300}>
            <RadarChart data={riskProfileData}>
              <PolarGrid />
              <PolarAngleAxis dataKey="feature" />
              <PolarRadiusAxis angle={30} domain={[0, 100]} />
              <Radar name="Profile A" dataKey="A" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6} />
              <Radar name="Profile B" dataKey="B" stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.6} />
              <Radar name="Profile C" dataKey="C" stroke="#ffc658" fill="#ffc658" fillOpacity={0.6} />
              <Legend />
            </RadarChart>
          </ResponsiveContainer>
        </div>

        {/* Feature Types Section */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Feature Types</h2>
          <div className="grid grid-cols-2 gap-4">
            <div>
              <h3 className="font-medium mb-2">Numerical Features</h3>
              <ul className="list-disc pl-5">
                {dataOverview.data_types.numerical.map((feature, index) => (
                  <li key={index}>{feature}</li>
                ))}
              </ul>
            </div>
            <div>
              <h3 className="font-medium mb-2">Categorical Features</h3>
              <ul className="list-disc pl-5">
                {dataOverview.data_types.categorical.map((feature, index) => (
                  <li key={index}>{feature}</li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ExploratoryDataAnalysisPage;
